import React from 'react';
import{ Button,Form,FromGroup,Label,Input, FormGroup} from 'reactstrap';


const login =(props) => {
  return(
   <Form className ="login-form">
   <h1>
   <span className="font-weight-bold">mywebside</span>.com
   </h1>
   <h2>Welcome</h2>
   <FormGroup>
     <Label>Email</Label>
     <input type="email" placeholder="Email"></input>
   </FormGroup>
  </Form>

  );
  }


 export default login;
